English:
Project load failed. Unable to load {0}

The .yyp file is corrupted and cannot be read.
You may need to restore your project from your source control or other backup to be able to continue.

Translation:
项目加载失败。无法加载 {0}

.yyp 文件已损坏，无法读取。
您可能需要从源代码控制或其他备份中恢复您的项目，以便继续。

English:
GameMaker is unable to access vital system folders.
Please check your paths in preferences and verify your folder permissions or contact your system administrator.

{0}

Translation:
GameMaker 无法访问重要的系统文件夹。
请在首选项中检查您的路径并验证您的文件夹权限，或与您的系统管理员联系。

